caption:
Mereces un respiro de vida 🫁🚭

Este martes 7 de febrero participaremos en la audiencia pública de @CamaraColombia sobre la reglamentación del uso de #vapeadores en el país, como líderes de la salud respiratoria en #Colombia y ceñidos a la evidencia científica nuestra presidente nacional, Dra. Ledys del Carmen Blanquicett Barrios y el coordinador del Comité para la Prevención y Control del Tabaco, sus derivados, SEAN y Medio Ambiente, Dr. Germán Díaz Santos, hablarán sobre las implicaciones, riesgos y consecuencias de #vapear.

Estaremos desde las 8:00 a.m. en directo desde el Salón Boyacá del Capitolio Nacional, transmisión en Facebook Live.

